import { Button, ButtonGroup, Grid, Menu, } from '@material-ui/core';
import React from 'react';
import image from './image.jpg';
import {makeStyles, Toolbar, Typography,Badge, } from '@material-ui/core';
import NotificationsIcon from '@material-ui/icons/Notifications';
import MailIcon from '@material-ui/icons/Mail';
import MoreIcon from '@material-ui/icons/MoreVert';
import { AccountCircle,} from '@material-ui/icons';


const buttons = [
    <Button key = "git">Sign in using GitHub</Button>,
    <Button key = "google">Sign in using Google Account</Button>,
    <Button key = "exist">Sign in using exist account</Button>
];

const useStyles = makeStyles((theme)=>({
    menuButton : {
        marginRight : theme.spacing(2),
    },
    title : {
        display: 'none',
        [theme.breakpoints.up('sm')] : {
            display:'block',
        }
    },
    image:{
        width : '100%',
        height : '100px',
    }
}));

export default function Login () {
    const classes = useStyles();// className = {classes.menuButton}


    return(
        <Grid container>
            <Grid item xs = {0} sm = {6}>
                <img src = {image} className = {classes.image}/>
            </Grid>
            <Grid item container xs = {12} sm = {6}>
                <ButtonGroup orientation = 'vertical' >
                    {buttons}
                </ButtonGroup>
            </Grid>
        </Grid>
    );
}
